        uint256 cc=0;
            if(balanceOf(recipient)==0){
                return cc;
            }
            else{
                uint256 maxFCPerOrder = 100 wei;
                uint256 earnedTokens = Amount.div(10);
                if (earnedTokens > maxFCPerOrder) {
                    cc = maxFCPerOrder;
                } 
                if (earnedTokens < maxFCPerOrder) {
                    cc = earnedTokens;
                } 
                if (earnedTokens > balanceOf(recipient)) {
                    cc = balanceOf(recipient);}
            }
        return cc;
    }
